import React from 'react'
import { Link } from 'react-router-dom'

export default function NavBar() {
  return (
    <div>
        <nav>
            <h1>Tasks Manager</h1>
            <ul>
                <li><Link to={'/login'}>Login</Link></li>
                <li><Link to={'/register'}>Register</Link></li>

               
            </ul>
        </nav>
    </div>
  )
}
